B.Jx=new A.a5(8,{hasProx:!0,isSendAnswer:!1,header:"Sistematiza\xe7\xe3o de ferramentas para Avalia\xe7\xe3o Psicopatol\xf3gica utilizando t\xe9cnicas de Intelig\xeancia Artificial",type:"terms",body1:'\n  TERMO DE CONSENTIMENTO LIVRE E ESCLARECIDO\n\n  \nVoc\xea est\xe1 sendo convidado (a) a participar da pesquisa intitulada \u201cSistematiza\xe7\xe3o de ferramentas para Avalia\xe7\xe3o Psicopatol\xf3gica utilizando t\xe9cnica de Intelig\xeancia Artificial\u201d, sob a responsabilidade dos pesquisadores Prof. Dr. Keiji Yamanaka, Ms. R\xe9sia da Silva Morais (da Faculdade de Engenharia El\xe9trica da Universidade Federal de Uberl\xe2ndia). Nesta pesquisa n\xf3s estamos buscando confirmar a possibilidade de usar t\xe9cnicas de intelig\xeancia artificial para avaliar as estruturas de sa\xfade mental chamadas de Fun\xe7\xf5es Mentais Ps\xedquicas (aten\xe7\xe3o, consci\xeancia, orienta\xe7\xe3o, experi\xeancias de tempo e de espa\xe7o, sensopercep\xe7\xe3o, mem\xf3ria, afetividade, vontade e psicomotricidade, pensamento, ju\xedzos de realidade, linguagem, intelig\xeancia e cogni\xe7\xe3o social), essenciais para uma excelente avalia\xe7\xe3o psicopatol\xf3gica com o objetivo de ajudar os profissionais da \xe1rea da sa\xfade mental. \nO Termo/Registro de Consentimento Livre e Esclarecido est\xe1 sendo obtido pelos pesquisadores Dr. Keiji Yamanaka e Ms. R\xe9sia da Silva Morais, antecedendo toda e qualquer experimenta\xe7\xe3o que envolva a pesquisa. Conforme o item IV da Resol. CNS 466/12 ou Cap. III da Resol. 510/2016, o participante ter\xe1 o tempo que julgar necess\xe1rio para decidir se deseja participar da pesquisa. Se voc\xea tiver qualquer d\xfavida em rela\xe7\xe3o \xe0 pesquisa, voc\xea pode entrar em contato com o(a) pesquisador(a) pelo e-mail duvidaspsicopatologiacomia@gmail.com para discutir as informa\xe7\xf5es do estudo\nNa sua participa\xe7\xe3o, ap\xf3s voc\xea ter compreendido as informa\xe7\xf5es que constituem o Termo de Consentimento Livre e Esclarecido e ap\xf3s ter assinado eletronicamente o campo no qual \u201cConcorda\u201d participar da pesquisa, ser\xe3o apresentadas telas com as instru\xe7\xf5es das tarefas que voc\xea ir\xe1 responder. Certifique-se que esteja em um ambiente silencioso, sem est\xedmulos de distra\xe7\xe3o. Em algumas telas ser\xe3o apresentados sons, sendo assim, fundamental o uso de fones ou que voc\xea ligue os alto-falantes do seu dispositivo. A avalia\xe7\xe3o das Fun\xe7\xf5es Ps\xedquicas ser\xe1 atrav\xe9s de 45 testes apresentados atrav\xe9s de 66 telas e voc\xea gastar\xe1 em torno de 25 minutos. Em algumas quest\xf5es, ser\xe1 solicitado que voc\xea ou\xe7a primeiramente alguns sons para respond\xea-las, e cada tela apresentada pelo question\xe1rio interativo permitir\xe1 a identifica\xe7\xe3o da rela\xe7\xe3o entre as respostas dadas por voc\xea e sinais de poss\xedveis fun\xe7\xf5es mentais afetadas.\nAs respostas ser\xe3o coletadas e registradas por meio da plataforma do Google Forms e do sistema TensorFlow que agrupar\xe1 os dados possibilitando a an\xe1lise das ferramentas de avalia\xe7\xe3o psicopatol\xf3gica. O pesquisador respons\xe1vel atender\xe1 as orienta\xe7\xf5es das Resolu\xe7\xf5es n\xba 466/2012, Cap\xedtulo XI, Item Xl.2: f e n\xba 510/2016, Cap\xedtulo VI, Art. 28: IV; e manter\xe1 os dados da pesquisa em arquivo, f\xedsico ou digital, sob sua guarda e responsabilidade, por um per\xedodo m\xednimo de 5 (cinco) anos ap\xf3s o t\xe9rmino da pesquisa. Uma vez conclu\xedda a coleta de dados, o pesquisador respons\xe1vel ir\xe1 fazer o download dos dados coletados para um dispositivo eletr\xf4nico local, apagando todo e qualquer registro de qualquer plataforma virtual, ambiente compartilhado ou "nuvem". Em nenhum momento voc\xea ser\xe1 identificado. Os resultados da pesquisa ser\xe3o publicados e ainda assim a sua identidade ser\xe1 preservada.\nVoc\xea n\xe3o ter\xe1 nenhum gasto e nem ganho financeiro por participar na pesquisa. Voc\xea n\xe3o receber\xe1 pagamentos por ser participante.  Todas as informa\xe7\xf5es obtidas por meio de sua participa\xe7\xe3o ser\xe3o de uso exclusivo para esta pesquisa e ficar\xe3o sob a guarda do/da pesquisador/a respons\xe1vel. Havendo algum dano decorrente da pesquisa, voc\xea ter\xe1 direito a solicitar indeniza\xe7\xe3o atrav\xe9s das vias judiciais (C\xf3digo Civil, Lei 10.406/2002, Artigos 927 a 954 e Resolu\xe7\xe3o CNS n\xba 510 de 2016, Artigo 19).\nOs riscos consistem em possibilidade de cansa\xe7o durante a realiza\xe7\xe3o da prova e algum desconforto relacionado a utiliza\xe7\xe3o dos testes. Para minimizar os riscos o instrumento de coleta de dados ser\xe1 respondido de forma virtual e an\xf4nima. Os pesquisadores se comprometem a tomar medidas de prote\xe7\xe3o e confidencialidade dos dados para que o sigilo da sua identidade seja preservado. Na possibilidade de ocorrer algum desconforto emocional durante a realiza\xe7\xe3o da prova, fique \xe0 vontade para entrar em contato pelo e-mail duvidaspsicopatologiacomia@gmail.com, e ser\xe1 acolhido pelo pesquisador assistente (Psic\xf3logo Cl\xednico). Caso o pesquisador identificar necessidade de continuidade da assist\xeancia, de forma virtual, voc\xea receber\xe1 orienta\xe7\xf5es psicoterap\xeauticas breve e ser\xe1 encaminhado (a) para atendimento psicol\xf3gico na rede p\xfablica mais pr\xf3xima da sua resid\xeancia. Os benef\xedcios ser\xe3o a expans\xe3o do seu conhecimento sobre a import\xe2ncia da intelig\xeancia artificial como um meio auxiliar no processo de avalia\xe7\xe3o psicol\xf3gica, o que pode facilitar o trabalho cl\xednico interventivo dos profissionais da sa\xfade mental. Os dados da pesquisa ser\xe3o mantidos em arquivo, f\xedsico e digital, sob sua guarda e responsabilidade, por um per\xedodo m\xednimo de 5 (cinco) anos ap\xf3s o t\xe9rmino da pesquisa, conforme cap\xedtulo VI da resolu\xe7\xe3o CNS 510, de 07 de abril de 2016. \nVoc\xea \xe9 livre para deixar de participar da pesquisa a qualquer momento sem qualquer preju\xedzo ou coa\xe7\xe3o. At\xe9 o momento da divulga\xe7\xe3o dos resultados, voc\xea tamb\xe9m \xe9 livre para solicitar a retirada dos seus dados da pesquisa. Uma via original deste Termo de Consentimento Livre e Esclarecido ficar\xe1 com voc\xea, voc\xea poder\xe1 salvar em seu dispositivo eletr\xf4nico. Em caso de qualquer d\xfavida ou reclama\xe7\xe3o a respeito da pesquisa, voc\xea poder\xe1 entrar em contato com: Dr. Keiji Yamanaka, Faculdade de Engenharia El\xe9trica da Universidade Federal de Uberl\xe2ndia. Av. Jo\xe3o Naves de \xc1vila, 2121 Campus Santa M\xf4nica - Universidade Federal de Uberl\xe2ndia CEP 38400-902 - Uberl\xe2ndia MG - Brasil - Fone (sala coordena\xe7\xe3o): (34) 3239-4706, ou com a Pesquisadora Psic\xf3loga Ms. R\xe9sia Silva de Morais, Faculdade de Engenharia El\xe9trica da Universidade Federal de Uberl\xe2ndia. Av. Jo\xe3o Naves de \xc1vila, 2121Campus Santa M\xf4nica - Universidade Federal de Uberl\xe2ndia, CEP 38400-902 - Uberl\xe2ndia MG - Brasil \u2013 e-mail: duvidaspsicopatologiacomia@gmail.com. Para obter orienta\xe7\xf5es quanto aos direitos dos participantes de pesquisa acesse a cartilha no link:https://conselho.saude.gov.br/images/comissoes/conep/documentos/Cartilha_Direitos_Eticos_2020.pdf.\nVoc\xea poder\xe1 tamb\xe9m entrar em contato com o CEP - Comit\xea de \xc9tica na Pesquisa com Seres Humanos na Universidade Federal de Uberl\xe2ndia, localizado na Av. Jo\xe3o Naves de \xc1vila, n\xba 2121, bloco A, sala 224, campus Santa M\xf4nica \u2013 Uberl\xe2ndia/MG, 38408-100; telefone: 34-3239-4131 ou pelo e-mail: cep@propp.ufu.br. O CEP \xe9 um colegiado independente criado para defender os interesses dos participantes das pesquisas em sua integridade e dignidade e para contribuir para o desenvolvimento da pesquisa dentro de padr\xf5es \xe9ticos conforme resolu\xe7\xf5es do Conselho Nacional de Sa\xfade.\nAo assinalar a op\xe7\xe3o \u201cConcordo\u201d, a seguir, voc\xea declara que aceita participar do projeto citado acima, voluntariamente, ap\xf3s ter sido devidamente esclarecido, pelos pesquisadores; que entendeu como \xe9 a pesquisa, que pode solicitar esclarecimentos em rela\xe7\xe3o as d\xfavidas com o/a pesquisador/a via e-mail (duvidaspsicopatologiacomia@gmail.com); e que pode desistir em qualquer momento, durante e depois de participar; voc\xea autoriza a divulga\xe7\xe3o dos dados obtidos neste estudo mantendo em sigilo sua identidade. \n',body2:"Solicitamos que voc\xea salve este documento em seus arquivos. Se desejar receber uma c\xf3pia deste registro de consentimento por e-mail, por favor, preencha-o abaixo e clique no bot\xe3o de enviar:\n",body3:"\n  DECLARA\xc7\xc3O DOS PESQUISADORES\n\nDeclaramos que obtivemos de forma apropriada e volunt\xe1ria, o Consentimento Livre e Esclarecido deste participante para a participa\xe7\xe3o neste estudo. Declaramos ainda que nos comprometemos a cumprir todos os termos aqui descritos;\n",image:B.Fx},B.FK,t.R)
